          </Grid.Column>


          <Grid.Column width={12}>


          <SuggestedJobs />


          </Grid.Column><Grid.Column width={4}>


          <Route path="/" component={JobList}/>


          </Grid.Column>






        </Grid.Row>
      </Grid>

    </div>
  )
}
